import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  ArrowRightIcon, 
  CheckCircleIcon, 
  MagnifyingGlassIcon,
  BuildingOfficeIcon,
  UserGroupIcon,
  ShieldCheckIcon,
  ChartBarIcon,
  MapPinIcon,
  ClockIcon,
  DocumentCheckIcon,
  BuildingLibraryIcon,
  CreditCardIcon
} from '@heroicons/react/24/outline';

const sampleData = [
  {
    id: 1,
    name: "Dr. Sarah Johnson, MD",
    specialty: "Cardiology",
    specialtyColor: "red",
    location: "New York, NY",
    hospital: "Mount Sinai Hospital",
    email: "sarah.johnson@mountsinai.org",
    phone: "(212) 555-0123"
  },
  {
    id: 2,
    name: "Dr. Michael Chen, DO",
    specialty: "Orthopedics",
    specialtyColor: "blue",
    location: "Los Angeles, CA",
    hospital: "UCLA Medical Center",
    email: "m.chen@ucla.healthcare.org",
    phone: "(310) 555-0124"
  },
  {
    id: 3,
    name: "Dr. Emily Rodriguez, MD",
    specialty: "Pediatrics",
    specialtyColor: "green",
    location: "Boston, MA",
    hospital: "Boston Children's Hospital",
    email: "e.rodriguez@childrens.org",
    phone: "(617) 555-0125"
  },
  {
    id: 4,
    name: "Dr. James Wilson, MD",
    specialty: "Neurology",
    specialtyColor: "purple",
    location: "Chicago, IL",
    hospital: "Northwestern Memorial",
    email: "wilson.james@northwestern.org",
    phone: "(312) 555-0126"
  },
  {
    id: 5,
    name: "Dr. Lisa Thompson, MD",
    specialty: "Dermatology",
    specialtyColor: "pink",
    location: "Houston, TX",
    hospital: "Houston Methodist",
    email: "l.thompson@methodist.org",
    phone: "(713) 555-0127"
  },
  {
    id: 6,
    name: "Dr. Robert Kim, MD",
    specialty: "Primary Care",
    specialtyColor: "emerald",
    location: "Los Angeles, CA",
    hospital: "Cedars-Sinai",
    email: "r.kim@cedars.org",
    phone: "(310) 555-0128"
  },
  {
    id: 7,
    name: "Dr. Maria Garcia, MD",
    specialty: "Cardiology",
    specialtyColor: "red",
    location: "Houston, TX",
    hospital: "Texas Medical Center",
    email: "m.garcia@texasmed.org",
    phone: "(713) 555-0129"
  },
  {
    id: 8,
    name: "Dr. David Park, MD",
    specialty: "Neurology",
    specialtyColor: "purple",
    location: "Boston, MA",
    hospital: "Mass General Hospital",
    email: "d.park@mgh.org",
    phone: "(617) 555-0130"
  }
];

const specialties = ["Cardiology", "Orthopedics", "Pediatrics", "Neurology", "Dermatology", "Primary Care"];
const locations = ["New York, NY", "Los Angeles, CA", "Chicago, IL", "Houston, TX", "Boston, MA"];

const LandingPage = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [currentData, setCurrentData] = useState([]);
  const [searchText, setSearchText] = useState("");
  const [selectedSpecialty, setSelectedSpecialty] = useState(0);
  const [selectedLocation, setSelectedLocation] = useState(0);

  // Filter data based on selected filters
  const filterData = () => {
    const specialty = specialties[selectedSpecialty];
    const location = locations[selectedLocation];

    let filtered = [...sampleData];

    // Filter by specialty if not "All Specialties"
    if (specialty && specialty !== "All Specialties") {
      filtered = filtered.filter(item => item.specialty === specialty);
    }

    // Filter by location if not "All Locations"
    if (location && location !== "All Locations") {
      filtered = filtered.filter(item => item.location === location);
    }

    // Return random 3 items from filtered results
    return filtered.sort(() => Math.random() - 0.5).slice(0, 3);
  };

  useEffect(() => {
    setIsVisible(true);

    // Initial data load
    setCurrentData(filterData());

    // Animate data changes
    const dataInterval = setInterval(() => {
      setCurrentData(filterData());
    }, 3000);

    // Animate search text
    const searchInterval = setInterval(() => {
      const specialty = specialties[selectedSpecialty];
      setSearchText(specialty === "All Specialties" ? "" : specialty);
      setSelectedSpecialty((prev) => (prev + 1) % specialties.length);
    }, 2000);

    // Animate location filter
    const locationInterval = setInterval(() => {
      setSelectedLocation((prev) => (prev + 1) % locations.length);
    }, 4000);

    return () => {
      clearInterval(dataInterval);
      clearInterval(searchInterval);
      clearInterval(locationInterval);
    };
  }, [selectedSpecialty, selectedLocation]);

  // Update data when filters change
  useEffect(() => {
    setCurrentData(filterData());
  }, [selectedSpecialty, selectedLocation]);

  return (
    <div className="min-h-screen bg-white">
      {/* Hero Section */}
      <div className="relative isolate px-6 pt-14 lg:px-8">
        <div className="mx-auto max-w-2xl py-32 sm:py-48 lg:py-56">
          <div className="text-center">
            <h1 className="text-4xl font-bold tracking-tight text-gray-900 sm:text-6xl">
              Find 9M healthcare provider emails
            </h1>
            <p className="mt-6 text-lg leading-8 text-gray-600">
              Unlock verified contact information for healthcare providers across the United States. 
              The most comprehensive database for B2B sales teams targeting medical professionals.
            </p>
            <div className="mt-10 flex items-center justify-center gap-x-6">
              <Link
                to="/signup"
                className="rounded-md bg-indigo-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
              >
                Get Started
              </Link>
              <Link to="/docs" className="text-sm font-semibold leading-6 text-gray-900">
                Documentation <span aria-hidden="true"></span>
              </Link>
            </div>
          </div>
